import {Table} from "react-bootstrap";

import React, {useEffect,useState} from "react";

const Table_bamf = () => {

    const getTable = async() => {
        try{
            const response = await fetch("http://localhost:5000/rows")
            const jsonData = await response.json()

            console.log(jsonData)
        }
        catch (err){
            console.error(err.message)
        }
    }

    useEffect(() => {
        getTable();
    })

    return (
        <Table className="my-auto" striped bordered hover>
            <thead>
            <tr>
                <th>Date</th>
                <th>Name</th>
                <th>Count</th>
                <th>Distance</th>
            </tr>
            </thead>
            <tbody>
            <tr>
                <td>1</td>
                <td>Mark</td>
                <td>Otto</td>
                <td>@mdo</td>
            </tr>
            <tr>
                <td>2</td>
                <td>Jacob</td>
                <td>Thornton</td>
                <td>@fat</td>
            </tr>
            <tr>
                <td>3</td>
                <td colSpan={2}>Larry the Bird</td>
                <td>@twitter</td>
            </tr>
            </tbody>
        </Table>
    );
};

export default Table_bamf;
